import React from 'react';
import '../../pages/loginOrSingin/style.scss';

const Or = ({className}) => {
  const elementClass = className + " or-and-line-container";
  return (
    <div className={elementClass}>
      <div className="line"/>
      <span>OR</span>
      <div className="line"/>
    </div>
  )
}

Or.defaultProps = {
  className:""
}

export {Or};
